import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./components/Card";
import "./letras.js";

ReactDOM.render(
  <React.StrictMode>
    <div id="social"></div>
    <div id="text-output">
      <div id="cp-bg"></div>
    </div>
    <Card/>
  </React.StrictMode>,
  document.getElementById("root")
);
